import React from 'react';
import {Link} from "react-router-dom";
import accountLogo from "../../images/account-icon.svg";
import './NavMovieProfile.css';

const NavMovieProfile = ({ isProfileShown }) => {
    return (
        <div className={ isProfileShown ? "nav-movie__profile" : "nav-movie__profile nav-movie__profile_deleted" }>
            <Link to="/profile" className="nav-movie__link">Аккаунт</Link>
            <img className="nav-movie__profile-logo" src={accountLogo} alt="Логотип"/>
        </div>
    );
};

export default NavMovieProfile;
